import React from 'react';
import { Link } from 'react-router-dom';

function Deposit(){
    return (
        <div className='container'>
            <div className='form-area'>
                <form action='#' method='post'>
                    <input type='num'></input>
                </form>
            </div>
        </div>
    )
}


export default Deposit;
